(window.webpackJsonp=window.webpackJsonp||[]).push([[1346],{1701:function(n,h,t){"use strict";t.r(h);var g=t(44),i=Object(g.a)({},(function(){var n=this,h=n.$createElement,t=n._self._c||h;return t("ContentSlotsDistributor",{attrs:{"slot-key":n.$parent.slotKey}},[t("h1",{attrs:{id:"chuong-2183-phuong-cuu-ca"}},[t("a",{staticClass:"header-anchor",attrs:{href:"#chuong-2183-phuong-cuu-ca"}},[n._v("#")]),n._v(" Chương 2183: Phượng Cửu Ca")]),n._v(" "),t("hr"),n._v(" "),t("p",[n._v("Truyền thừa ngàn năm, vạn năm gia tộc, cành lá um tùm, hậu bối ra ngoài thí luyện, có khả năng bị giết hại, có khả năng vây ở nơi nào đó, có khả năng nhận được kỳ ngộ... Từ đó một đi không trở lại, cuối cùng ghi lại bên trong, không giải quyết được gì, mà trên thực tế, vẫn là có hậu đại còn sống ở thế."),t("br"),t("br"),n._v("Liền giống như Vân Ly thiên, thông cáo toàn bộ Thần giới, một khi phát hiện Long tộc huyết mạch, không cho phép thuần phục cùng giao dịch, mục đích đúng là sắp tán rơi vào bên ngoài bàng chi, mang về trong tộc."),t("br"),t("br"),n._v("Trương Huyền tình huống hiện tại, hoàn toàn có thể giả mạo một cái cùng như vậy chi nhánh, đi tới đối phương gia tộc tham gia khảo hạch."),t("br"),t("br"),n._v("Chỉ cần huyết mạch kiểm tra không ra vấn đề, liền sẽ không phát sinh nguy hiểm."),t("br"),t("br"),n._v("Còn là ai..."),t("br"),t("br"),n._v("Rất nhiều chi nhánh, đều bị đứt đoạn truyền thừa mấy ngàn năm, trên vạn năm, đi đâu kiểm tra?"),t("br"),t("br"),n._v("Căn bản không thể nào tra được!"),t("br"),t("br"),n._v("“Cứ làm như thế...”"),t("br"),t("br"),n._v("Trong lòng cân nhắc một chút, xác nhận không có vấn đề, thế này mới đúng lấy tam đại gia tộc bên trong khoảng cách gần nhất cái kia, bay lượn mà đi."),t("br"),t("br"),n._v("Đây là Hỏa Vũ phong hào Thần Vương chưởng khống phạm vi, khu phố nhà, đều hiện ra hỏa hồng chi sắc, nóng bỏng ánh nắng bao phủ xuống, nửa cái thành thị, tựa như hấp lô."),t("br"),t("br"),n._v("Nếu không phải ở đây sinh hoạt người, đều đạt đến Thần Linh cảnh giới, thân thể mạnh mẽ, chỉ sợ thêm một phút đều không kiên trì nổi."),t("br"),t("br"),n._v("Trương Huyền thân thể, trải qua Nguyệt Thanh trì rèn luyện, sớm đã có thể so với thượng phẩm Thiên Thần khí, điểm ấy nhiệt lượng không đáng kể chút nào."),t("br"),t("br"),n._v("Một đường tiến lên, tìm người hỏi thăm Hỏa Phượng nhất mạch chỗ trụ sở, đi vào trước mặt."),t("br"),t("br"),n._v("Là một tòa to lớn phủ đệ, cùng trước đó Tề gia đồng dạng, xung quanh giăng đầy to lớn trận pháp, để cho người ta không dám tùy tiện đi vào tiến vào bên trong."),t("br"),t("br"),n._v("Trương Huyền cũng không sốt ruột đi qua, mà tại đối diện tìm to lớn quán rượu."),t("br"),t("br"),n._v("Hộ vệ đối tam đại gia tộc biết đói không nhiều, nơi này ngư long hỗn tạp, có lẽ có thể hỏi thăm ra một ít, tin tức hữu dụng, không đến mức đến thời điểm hai mắt đen thui, cái gì cũng không biết."),t("br"),t("br"),n._v("Tìm cái vị trí gần cửa sổ ngồi xuống, yêu cầu một ít rượu thịt, vừa ăn vài miếng, chỉ thấy cách đó không xa đại môn “Kẹt kẹt!” Mở ra, một bóng người đánh cái lảo đảo, té ngã trên đất."),t("br"),t("br"),n._v("“Cút đi!”"),t("br"),t("br"),n._v("Ngay sau đó hai cái thanh niên, đi ra, trên người tràn đầy vênh vang đắc ý mùi vị."),t("br"),t("br"),n._v("“Phượng Triêu, Phượng Tường, các ngươi đừng khinh người quá đáng!”"),t("br"),t("br"),n._v("Ngã sấp xuống thanh niên, giẫy giụa đứng lên, nắm đấm xiết chặt."),t("br"),t("br"),n._v("Hắn chừng hai mươi tuổi hình dáng, mi tâm một đạo hỏa diễm sắc ấn ký, trên mặt có được không khỏe mạnh trắng bệch, hẳn là bị thương không nhẹ."),t("br"),t("br"),n._v("“Khinh người quá đáng?” Gọi là Phượng Triêu thanh niên, cười nhạo một tiếng: “Phượng Cửu Ca, chẳng lẽ ngươi còn tưởng rằng đây là hai năm trước? Ngươi bây giờ, sớm đã không phải thiên tài, huyết mạch cũng thiêu đốt hầu như không còn, bị triệt để trục xuất hạch tâm! Cút, miễn cho chúng ta động thủ, nếu không, đừng trách chúng ta không khách khí...”"),t("br"),t("br"),n._v("“Hai năm trước, ngươi thiên phú cao, thực lực mạnh, có thể đối với chúng ta diễu võ giương oai, hiện tại... Đáng là gì! Một cái phế vật vô dụng mà thôi! Không nhanh chút rời khỏi, nhiều hơn nữa nói nhảm lời nói, coi như đem ngươi ném vào lồng thú, cũng không ai dám nói cái gì!”"),t("br"),t("br"),n._v("Phượng Tường khẽ nói."),t("br"),t("br"),n._v("Kẽo kẹt! Kẽo kẹt!"),t("br"),t("br"),n._v("Gọi là Phượng Cửu Ca thanh niên, xiết chặt nắm đấm, muốn nói điều gì, cuối cùng vẫn không nói ra, lộ ra một tia buồn bã, xoay người đi ra ngoài."),t("br"),t("br"),n._v("“Đáng tiếc!”"),t("br"),t("br"),n._v("“Ai nói không phải, vị này Phượng Cửu Ca, mấy năm trước, tại Hỏa Phượng nhất tộc, là chói mắt nhất thiên tài, đáng tiếc một lần biến cố, huyết mạch hủy hết, tu vi trì trệ không tiến không nói, thậm chí còn lùi lại không ít, về sau bị trục xuất hạch tâm, đến bây giờ, thành người người khi dễ đối tượng!”"),t("br"),t("br"),n._v("“Gia tộc tử đệ liền như thế, có thực lực, có huyết mạch, chính là người người tôn sùng hạch tâm, không có hai thứ này, địa vị lập tức ngã vào đáy cốc, chẳng phải là cái gì!”"),t("br"),n._v(" “Linh khí tán loạn, liền xem như Hỏa Phượng nhất tộc, tài nguyên cũng có hạn chế, không phải hạch tâm đệ tử, không có tài nguyên cung cấp, thành tựu có hạn, đây cũng là không có cách nào chuyện...”"),t("br"),t("br"),n._v("..."),t("br"),t("br"),n._v("Trong tửu lâu không ít người thấy cảnh này, vang lên hạ giọng thảo luận."),t("br"),t("br"),n._v("Nghe một hồi, Trương Huyền hiểu được."),t("br"),t("br"),n._v("Vị này Phượng Cửu Ca, hai năm trước, xem như toàn bộ Hỏa Phượng nhất tộc, chói mắt nhất thiên tài một trong, tuổi còn trẻ liền đạt đến trung phẩm Thiên Thần cảnh giới, đối võ kỹ hiểu, thế hệ trẻ tuổi, càng là không người có thể đưa ra phải, trong lúc nhất thời phong quang không gì sánh bằng."),t("br"),t("br"),n._v("Đáng tiếc, may mắn không thường tại, vị này trong tộc chói mắt minh tinh, một lần ra khỏi thành thí luyện, không biết đã trải qua cái gì, bản thân bị trọng thương không nói, huyết mạch cũng giống là bị tước đoạt đồng dạng, biến mất không thấy hình bóng."),t("br"),t("br"),n._v("Thương thế khôi phục về sau, tài nguyên cung cấp đường thẳng giảm bớt, tại trong tộc địa vị, cũng nhận nghi ngờ, trước mấy ngày, lần nữa đo lường huyết mạch, ẩn chứa mức độ, đã thấp đến liền phổ thông đệ tử cũng không bằng tình trạng, ngay sau đó bị thủ tiêu hạch tâm đệ tử thân phận, đuổi ra khỏi gia tộc."),t("br"),t("br"),n._v("Không cam lòng chịu nhục, cố gắng muốn khôi phục trước đó địa vị, lại bị Phượng Triêu, Phượng Tường hai người đả thương, cũng liền xuất hiện, vừa mới nhìn thấy một màn."),t("br"),t("br"),n._v("“Lúc trước hắn là trong tộc minh tinh, người người ngưỡng mộ, nắm giữ Thần Vương phong thái, vô số người tâng bốc, Thần Vương tiềm lực bảng cường giả gặp được, đều muốn xưng huynh gọi đệ, mà Phượng Triêu, Phượng Tường chính là trong đó nhất bán mạng một đôi, hiện tại mất đi cái thân phận này, tự nhiên phản kích lợi hại nhất!”"),t("br"),t("br"),n._v("“Người chính là như vậy, lúc trước chó xù đồng dạng, lúc trước có bao nhiêu khiêm tốn, hiện tại liền có bao nhiêu tàn nhẫn cùng cao ngạo!”"),t("br"),t("br"),n._v("Đám người lắc đầu."),t("br"),t("br"),n._v("Thần giới, tu vi đệ nhất, không có thực lực, cái gì cũng không bằng."),t("br"),t("br"),n._v("Không trách được người khác."),t("br"),t("br"),n._v("Thảo luận bên trong, trên người tràn đầy vết thương Phượng Cửu Ca, đi vào quán rượu, ngồi tại khoảng cách chỗ không xa, từng ngụm từng ngụm uống rượu."),t("br"),t("br"),n._v("Trương Huyền nhìn sang."),t("br"),t("br"),n._v("Vị này đã từng thiên tài, tu vi quả nhiên không tính rất mạnh, chỉ có hạ phẩm Thiên Thần cảnh, hơn nữa chân khí lực lượng yếu đuối, xem ra không những không thể đột phá, vô cùng có khả năng, lần nữa hạ xuống."),t("br"),t("br"),n._v("“Tu vi hạ xuống? Đây là đã trải qua cái gì?”"),t("br"),t("br"),n._v("Trương Huyền tràn đầy kỳ lạ."),t("br"),t("br"),n._v("Dưới tình huống bình thường, trừ phi bản thân bị trọng thương, trong kinh mạch tức toàn bộ phá hủy, nếu không, đến cảnh giới nhất định tu vi, rất khó lui bước."),t("br"),t("br"),n._v("Vị này thân thể tình huống cùng trước đó mọi người nói bộ dáng, đỉnh phong nhất lúc, vô cùng có khả năng cũng giống như mình, đạt đến thượng phẩm Thiên Thần đỉnh phong, hiện tại không chỉ có không có loại thực lực này, còn bất cứ lúc nào cũng sẽ rớt phá Thiên Thần..."),t("br"),t("br"),n._v("Đây rốt cuộc gặp chuyện gì, gặp phải như vậy phản phệ?"),t("br"),t("br"),n._v("“Nhìn một chút...”"),t("br"),t("br"),n._v("Minh Lý Chi Nhãn nhúc nhích, cẩn thận hướng thanh niên trước mắt nhìn sang, lông mày nhịn không được nhăn lại."),t("br"),t("br"),n._v("“Sát lục khí tức?”"),t("br"),t("br"),n._v("Trước mắt người thanh niên này, trong cơ thể vậy mà ẩn chứa một cỗ nồng đậm sát lục chi khí, tuy là bị nấp rất kỹ, nhưng vẫn là chạy trốn không xong Minh Lý Chi Nhãn quan sát."),t("br"),t("br"),n._v("“Sát lục chi khí, chỉ cần trải qua chiến đấu, rất nhiều người đều có, đặc biệt là tiến vào sa trường binh sĩ, tướng quân. Lúc trước Trác Phong trong cơ thể cũng là như vậy, chỉ là...”"),t("br"),t("br"),n._v("Trương Huyền tràn đầy không hiểu: “Hắn cỗ này sát lục chi khí, thế mà cùng Dị Linh tộc nhân có chút giống nhau.”"),t("br"),t("br"),n._v("Cách đó không xa cái này gọi Phượng Cửu Ca thanh niên, trong cơ thể vậy mà ẩn chứa Dị Linh tộc nhân mới có sát lục chi khí, để hắn trong nháy mắt sinh ra nồng đậm hứng thú."),t("br"),t("br"),n._v("Người đăng: ThấtDạ"),t("br"),t("br"),t("br"),t("br")]),n._v(" "),t("hr"),n._v(" "),t("p",[t("a",{attrs:{href:"./chap-2197"}},[n._v("Chương trước")]),n._v("  |  "),t("a",{attrs:{href:"./chap-2199"}},[n._v("Chương sau")])])])}),[],!1,null,null,null);h.default=i.exports}}]);